                <ScrollContainer snap="mandatory">
                    <ScrollPage>
                        <Animator animation={batch(Fade(), Sticky(), MoveOut(0, -200))}>
                        </Animator>
                    </ScrollPage>
                </ScrollContainer>
                <Card photo={test_card[0]} info={test_card[1]} price={test_card[2]} />
